column1:
Командир авиационного полка отметил следующие недостатки в обеспечении полетов:

* Обеспечение полетов со стороны обслуживавшей их службы было низким;
* Потребовалось срочное вмешательство для решения возникших проблем;
* Обслуга была недостаточна, что привело к задержке полетов.

Оценка соответствующая: низкая (Low).	На разборе полетов командир авиационного полка указывает недостатки по обеспечению полетов со стороны о б а т о и ставит соответствующую оценку.	На разборе полетов командир авиационного полка указывает недостатки по обеспечению полетов со стороны ОБАТО и ставит соответствующую оценку.	3091	LETTERS
